const OptimizeTest = () => {
  const [count, setcount] = useState(0);

  const [text, settext] = useState("");
  return (
    <div style={{ padding: 50 }}>
      <div>
        <h2>count</h2>
        <button
          onClick={() => {
            setcount(count + 1);
          }}
        >
          +
        </button>
      </div>
    </div>
  );
};

export default OptimizeTest;
